import React from 'react'



const SignInInput = () => {
  return (
    <Authenticator>
      {({ signOut }) => (
        <div>
          <h1>
            Hello, Welcome to the first Blockchain powered Gallery
          </h1>
          <button onClick={ signOut }>Sign Out</button>
        </div>
      )}
    </Authenticator>
    );
};

export default SignInInput
